-- Empfohlen ist, zuerst die Attribute der Tabellen anzulegen und die Relationen 
-- anschließend vorzunehmen. dabei werden Sie erkennen, dass nicht jede Lösch-
-- reihenfolge (DROP) funktioniert.

CREATE TABLE `Benutzer` (
	`Nummer` INT UNSIGNED NOT NULL AUTO_INCREMENT,
	`E-Mail` VARCHAR(255) NOT NULL, -- Backticks wegen Minus im namen
	`Bild`  VARBINARY(1000) DEFAULT 123 NOT NULL , -- verbessern Sie die Datentypen, wenn nötig
	`Nutzername` VARCHAR(255) NOT NULL, -- NOT NULL weil nicht optional
	`Aktiv` BOOL DEFAULT false,
	`Hash` CHAR(60)  DEFAULT '000000000000000000000000000000000000000000000000000000000001' NOT NULL, -- http://dcx.sap.com/1200/de/dbreference/hash-function.html VARCHAR
	`LetzterLogin` DATETIME,
	`Anlegedatum` DATE NOT NULL DEFAULT CURRENT_DATE,
	`Geburtsdatum` DATE,
	`Vorname` VARCHAR(50) NOT NULL,
	`Nachname` VARCHAR(50) NOT NULL,
	`Alter` INT UNSIGNED, -- CHECK (CURRENT_DATE()-`Geburtsdatum`),
	PRIMARY KEY (`Nummer`),
	CONSTRAINT `NutzernameEindeutig` UNIQUE(`Nutzername`),
	CONSTRAINT `E-MailEindeutig` UNIQUE(`E-Mail`)
);


CREATE TABLE `FH Angehörige`(
	`FHAngehörig_ID` INT UNSIGNED NOT NULL,
	PRIMARY KEY(`FHAngehörig_ID`),
	CONSTRAINT `FH-Angehörige_isA_Benutzer` FOREIGN KEY(`FHAngehörig_ID`) REFERENCES `Benutzer`(`Nummer`)
	ON DELETE CASCADE
	ON UPDATE CASCADE
);

CREATE TABLE `Studenten`(
	`Student_ID` INT UNSIGNED NOT NULL,
	`Studiengang` ENUM('ET','INF','ISE','MCD','WI') NOT NULL,
	 `Matrikelnummer` INT(9) UNSIGNED NOT NULL CHECK (`Matrikelnummer`BETWEEN 10000000 AND 999999999),
	-- CONSTRAINT `MatrikelnummerGültig` CECK (`Matrikelnummer` BETWEEN 10000000 AND 999999999), 
	PRIMARY KEY(`Student_ID`),
	CONSTRAINT `MatrikelnummerEindeutig` UNIQUE(`Matrikelnummer`),-- MAtrikelnummer soll eindeutig sein
	CONSTRAINT `studenten_sind_FHAngehoerige` FOREIGN KEY(`Student_ID`) REFERENCES `FH Angehörige`(`FHAngehörig_ID`)
	ON DELETE CASCADE
	ON UPDATE CASCADE
);

CREATE TABLE `Mitarbeiter`(
	`Büro` VARCHAR(10) DEFAULT '',
	`Telefon` VARCHAR(20 )DEFAULT '', -- Telefonnummer als Char, und nicht int, da es auch +49 gibt
	`Mitarbeiter_ID` INT UNSIGNED,
	PRIMARY KEY(`Mitarbeiter_ID`),
	CONSTRAINT `TelefonEindeutig` UNIQUE(`Telefon`),
	CONSTRAINT `mitarbeiter_sind_FHAngehoerige` FOREIGN KEY(`Mitarbeiter_ID`) REFERENCES `FH Angehörige`(`FHAngehörig_ID`) 
	ON DELETE CASCADE
	ON UPDATE CASCADE
);


CREATE TABLE `Gäste`(
	`Grund` VARCHAR(254) NOT NULL,
	`Ablaufdatum` DATE NOT NULL DEFAULT (CURDATE()+7),
	`Gäste_ID` INT UNSIGNED NOT NULL,
	PRIMARY KEY(`Gäste_ID`),
	CONSTRAINT `Gäste_isA_Benutzer` FOREIGN KEY(`Gäste_ID`) REFERENCES `Benutzer`(`Nummer`)
	ON DELETE CASCADE
	ON UPDATE CASCADE
);


CREATE TABLE `Bestellungen` (
	`Nummer` INT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Bestell-Zeitpunkt` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP(),
	`Abholzeitpunkt` DATETIME CHECK(`Abholzeitpunkt` > `Bestell-Zeitpunkt`),
	`Endpreis` FLOAT(5,2) NOT NULL,
	`Benutzer.Nummer` INT UNSIGNED NOT NULL, -- müsste nicht Zwischenliste sein?
	PRIMARY KEY (`Nummer`),
	CONSTRAINT `Benutzer_tätigt_Bestellung` FOREIGN KEY (`Benutzer.Nummer`) REFERENCES `Benutzer` (`Nummer`) -- tätigt
);

CREATE TABLE `Bilder` (
	`ID` INT UNSIGNED AUTO_INCREMENT,
	`Alt-Text` VARCHAR(20) NOT NULL, -- denken Sie auch hier an Backticks
	`Titel` VARCHAR(20),
	`Binärdaten` MEDIUMBLOB NOT NULL,
	PRIMARY KEY (`ID`)
);

CREATE TABLE `Kategorien`(
	`ID` INT(10) UNSIGNED NOT NULL AUTO_INCREMENT,
	`Kategorien_ID` INT(10) UNSIGNED,
	`Bilder_ID` INT UNSIGNED,
	`Bezeichnung` VARCHAR(20) NOT NULL,
	PRIMARY KEY(`ID`)
);

ALTER TABLE Kategorien ADD CONSTRAINT FOREIGN KEY (`Bilder_ID`) REFERENCES Bilder(ID) ON DELETE SET NULL; -- Kategorien hat Bilder
ALTER TABLE Kategorien ADD CONSTRAINT FOREIGN KEY (`Kategorien_ID`) REFERENCES Kategorien(ID) ON DELETE SET NULL; -- Kategorien hat Kategorien

CREATE TABLE `Mahlzeiten` (
	`ID` INT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Name` VARCHAR(20) NOT NULL,
	`Verfügbar` BOOL NOT NULL DEFAULT 0, -- CHECK (`Vorrat` > 0),
	`Beschreibung` TEXT NOT NULL,
	`Vorrat` INT UNSIGNED NOT NULL DEFAULT 0,
	`Kategorien_ID` INT(10) UNSIGNED NOT NULL DEFAULT 0,
	PRIMARY KEY(`ID`),
	CONSTRAINT `Mahlzeit_in_Kategorien` FOREIGN KEY (`Kategorien_ID`) REFERENCES `Kategorien` (`ID`) -- in
);

CREATE TABLE `Preise` (
	`Jahr` YEAR NOT NULL,
	`Gastpreis` FLOAT(4,2) UNSIGNED NOT NULL,
	`MA-Preis` FLOAT(4,2) UNSIGNED,
	`Student-preis` FLOAT(4,2) UNSIGNED CHECK(`Student-preis` < `MA-Preis`),
	`Mahlzeiten_ID` INT(10) UNSIGNED NOT NULL,
	PRIMARY KEY(`Jahr`,`Mahlzeiten_ID`)
);
ALTER TABLE `Preise` ADD CONSTRAINT `Mahlzeiten_kostet_Preis` FOREIGN KEY (`Mahlzeiten_ID`) REFERENCES `Mahlzeiten` (`ID`) ON UPDATE CASCADE ON DELETE CASCADE; -- Mahlzeit kostet Pries

CREATE TABLE `Kommentare`(
	`ID` INT UNSIGNED NOT NULL AUTO_INCREMENT,
	`Bemerkung` TEXT,
	`Bewertung` INT UNSIGNED NOT NULL,
	`mahlzeiten_ID` INT UNSIGNED,
	`student_ID` INT UNSIGNED,
	PRIMARY KEY(`ID`),
	CONSTRAINT `studenten_schreibt_kommentare` FOREIGN KEY(`student_ID`) REFERENCES `Studenten`(`Student_ID`) ON UPDATE CASCADE ON DELETE CASCADE
);
ALTER TABLE `Kommentare` ADD CONSTRAINT `mahlzeiten_zu_Kommentare` FOREIGN KEY(`mahlzeiten_ID`) REFERENCES `Mahlzeiten`(`ID`) ON DELETE SET NULL; -- Kommentare zu Mahlzeit



CREATE TABLE `zutaten`(
	`ID` INT(5) UNSIGNED ZEROFILL NOT NULL DEFAULT 0,
	`Name` VARCHAR(255) NOT NULL,
	`Bio` BOOL NOT NULL,
	`Vegan` BOOL NOT NULL,
	`Vegetarisch` BOOL NOT NULL,
	`Glutenfrei` BOOL NOT NULL,
	PRIMARY KEY(`ID`)
);

CREATE TABLE `fachbereiche`(
	`Webseite` VARCHAR(100) NOT NULL,
	`Name` VARCHAR(50) NOT NULL,
	`Adresse` VARCHAR(50), -- Gegeben durch Public werte
	`ID` INT UNSIGNED NOT NULL AUTO_INCREMENT,
	PRIMARY KEY(ID)
);

CREATE TABLE `deklarationen`(
	`Zeichen` VARCHAR(2) NOT NULL,
	`Beschriftung` VARCHAR(32) NOT NULL,
	PRIMARY KEY(`Zeichen`)
);


CREATE TABLE `ZT_befreundet_Mit` (
	`Benutzer_Nummer_1` INT(10) UNSIGNED NOT NULL,
	`Benutzer_Nummer_2` INT(10) UNSIGNED NOT NULL,
	CONSTRAINT `Benutzer_Nummer_1` FOREIGN KEY (`Benutzer_Nummer_1`) REFERENCES `Benutzer` (`Nummer`),
	CONSTRAINT `Benutzer_Nummer_2` FOREIGN KEY (`Benutzer_Nummer_2`) REFERENCES `Benutzer` (`Nummer`)
);

CREATE TABLE `ZT_enthält` (
	`Bestellung_Nummer` INT(10) UNSIGNED NOT NULL,
	`Mahlzeit_ID` INT(10) UNSIGNED NOT NULL,
	`Anzahl` INT(10) UNSIGNED NOT NULL,
	CONSTRAINT `Bestellungen_Nummer` FOREIGN KEY (`Bestellung_Nummer`) REFERENCES `Bestellungen` (`Nummer`),
	CONSTRAINT `Mahlzeiten_ID_B` FOREIGN KEY (`Mahlzeit_ID`) REFERENCES `Mahlzeiten` (`ID`)
);

CREATE TABLE `ZT_Mahlzeiten_hat_Bilder` (
	`Mahlzeiten_ID` INT(10) UNSIGNED NOT NULL,
	`Bilder_ID` INT(10) UNSIGNED NOT NULL,
	CONSTRAINT `Bilder_ID` FOREIGN KEY (`Bilder_ID`) REFERENCES `Bilder` (`ID`),
	CONSTRAINT `Mahlzeiten_ID_Bi` FOREIGN KEY (`Mahlzeiten_ID`) REFERENCES `Mahlzeiten` (`ID`)
);

CREATE TABLE `ZT_Mahlzeiten_enthält_Zutaten` (
	`Mahlzeiten_ID` INT(10) UNSIGNED NOT NULL,
	`Zutaten_ID` INT(14) UNSIGNED NOT NULL
);
ALTER TABLE `ZT_Mahlzeiten_enthält_Zutaten` ADD CONSTRAINT `Mahlzeiten_ID_Z` FOREIGN KEY (`Mahlzeiten_ID`) REFERENCES `Mahlzeiten` (`ID`) ON UPDATE CASCADE ON DELETE CASCADE; -- Mahlzeit enthält Zutaten
ALTER TABLE `ZT_Mahlzeiten_enthält_Zutaten` ADD CONSTRAINT `Zutaten_ID_Z` FOREIGN KEY (`Zutaten_ID`) REFERENCES `zutaten` (`ID`) ON UPDATE CASCADE ON DELETE CASCADE; -- Mahlzeit enthält Zutaten, verliert zuordnung, ZT ist Zuordnung



CREATE TABLE `ZT_Mahlzeiten_braucht_Deklaration` (
	`Mahlzeiten_ID` INT(10) UNSIGNED NOT NULL,
	`Deklaration_Zeichen` VARCHAR(2) NOT NULL,
	CONSTRAINT `Deklarationen_Zeichen` FOREIGN KEY (`Deklaration_Zeichen`) REFERENCES `deklarationen` (`Zeichen`),
	CONSTRAINT `Mahlzeiten_ID` FOREIGN KEY (`Mahlzeiten_ID`) REFERENCES `Mahlzeiten` (`ID`)
);

CREATE TABLE `ZT_FHAngehoerige_gehoertZu_Fachbereiche` (
	`FH_Angehöriger_ID` INT UNSIGNED NOT NULL,
	`Fachbereich_ID` INT UNSIGNED NOT NULL,
	CONSTRAINT `ist_FH_Angehöriger` FOREIGN KEY(`FH_Angehöriger_ID`) REFERENCES `FH Angehörige`(`FHAngehörig_ID`),
	CONSTRAINT `gehört_zum_Fachbereich` FOREIGN KEY(`Fachbereich_ID`) REFERENCES `fachbereiche`(`ID`)
);

